import React, { Component } from 'react';
import PropTypes from 'prop-types';

export default class Header extends Component {
  render() {
    return (
      <div className="Header">
      	My Header
      </div>
    );
  }
}

Header.propTypes = {
	apps: PropTypes.array.isRequired
}
